import { useCallback, useState } from 'react';
import styles from './css/Companies.module.css';

const Companies = () => {
  const [formData, setFormData] = useState({
    representative_name: '',
    representative_gender: '',
    name: '',
    business_number: '',
    established_at: '',
    employee_count: '',
    company_type: '중소기업',
    preferred_fields: '',
    location: '',
    business_form: ''
  });

  const [loading, setLoading] = useState(false);
  const [errors, setErrors] = useState({});

  const handleInputChange = (field, value) => {
    setFormData(prev => ({
      ...prev,
      [field]: value
    }));
    
    if (errors[field]) {
      setErrors(prev => ({
        ...prev,
        [field]: ''
      }));
    }
  };

  const validateForm = () => {
    const newErrors = {};
    
    if (!formData.representative_name.trim()) {
      newErrors.representative_name = '대표자명을 입력해주세요.';
    }
    
    if (!formData.representative_gender) {
      newErrors.representative_gender = '대표자 성별을 선택해주세요.';
    }
    
    if (!formData.business_number.trim()) {
      newErrors.business_number = '사업자등록번호를 입력해주세요.';
    } else if (!/^\d{3}-\d{2}-\d{5}$/.test(formData.business_number)) {
      newErrors.business_number = '올바른 사업자등록번호 형식을 입력해주세요. (예: 123-45-67890)';
    }
    
    if (!formData.name.trim()) {
      newErrors.name = '상호(법인명)을 입력해주세요.';
    }

    setErrors(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const saveToDatabase = async (data) => {
    try {
      const response = await fetch('/api/companies', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(data)
      });

      if (!response.ok) {
        throw new Error('저장에 실패했습니다.');
      }

      const result = await response.json();
      return result;
    } catch (error) {
      console.error('Database save error:', error);
      throw error;
    }
  };

  const handleSave = async () => {
    if (!validateForm()) {
      alert('필수 항목을 모두 입력해주세요.');
      return;
    }

    setLoading(true);
    try {
      await saveToDatabase(formData);
      alert('정보가 성공적으로 저장되었습니다.');
    } catch (error) {
      alert('저장 중 오류가 발생했습니다. 다시 시도해주세요.');
    } finally {
      setLoading(false);
    }
  };

  const onGroupContainerClick = useCallback(() => {
    // Placeholder for navigation or other actions
  }, []);

  return (
    <div className={styles.ver2}>
      <div className={styles.div}>
        <img className={styles.child} alt="" src="Vector 573.svg" />
        <div className={styles.item} />
        <img className={styles.inner} alt="" src="Group 1000002831.svg" />
        <b className={styles.b}>이어봄</b>
        <img className={styles.vectorIcon} alt="" src="Vector.svg" />
        <div className={styles.vectorParent}>
          <img className={styles.groupChild} alt="" src="Vector 606.svg" />
          <div className={styles.wrapper}>
            <b className={styles.b1}>기본 정보</b>
          </div>
          <div className={styles.groupParent}>
            <div className={styles.parent}>
              <div className={styles.div1}>대표자명</div>
              <input
                className={styles.inputBasic}
                type="text"
                value={formData.representative_name}
                onChange={(e) => handleInputChange('representative_name', e.target.value)}
                placeholder="대표자명을 입력하세요"
              />
              {errors.representative_name && <div className={styles.error}>{errors.representative_name}</div>}
              <div className={styles.div3}>대표자 성별</div>
              <div className={styles.rectangleParent}>
                <label>
                  <input
                    type="radio"
                    name="gender"
                    value="남"
                    checked={formData.representative_gender === '남'}
                    onChange={() => handleInputChange('representative_gender', '남')}
                  />
                  남
                </label>
                <label>
                  <input
                    type="radio"
                    name="gender"
                    value="여"
                    checked={formData.representative_gender === '여'}
                    onChange={() => handleInputChange('representative_gender', '여')}
                  />
                  여
                </label>
              </div>
              {errors.representative_gender && <div className={styles.error}>{errors.representative_gender}</div>}
            </div>
            <div className={styles.inputBasicParent}>
              <div className={styles.div6}>상호(법인명)</div>
              <input
                className={styles.inputBasic}
                type="text"
                value={formData.name}
                onChange={(e) => handleInputChange('name', e.target.value)}
                placeholder="상호(법인명)을 입력하세요"
              />
              {errors.name && <div className={styles.error}>{errors.name}</div>}
              <div className={styles.div8}>사업자등록번호</div>
              <input
                className={styles.inputBasic}
                type="text"
                value={formData.business_number}
                onChange={(e) => handleInputChange('business_number', e.target.value)}
                placeholder="123-45-67890"
              />
              {errors.business_number && <div className={styles.error}>{errors.business_number}</div>}
            </div>
            <div className={styles.group}>
              <div className={styles.div12}>설립일자</div>
              <input
                className={styles.inputBasic}
                type="date"
                value={formData.established_at}
                onChange={(e) => handleInputChange('established_at', e.target.value)}
              />
              <div className={styles.div13}>직원 수</div>
              <input
                className={styles.inputBasic}
                type="number"
                value={formData.employee_count}
                onChange={(e) => handleInputChange('employee_count', e.target.value)}
                placeholder="직원 수를 입력하세요"
              />
            </div>
            <div className={styles.container}>
              <div className={styles.div12}>기업분류</div>
              <select
                className={styles.inputBasic}
                value={formData.company_type}
                onChange={(e) => handleInputChange('company_type', e.target.value)}
              >
                <option value="중소기업">중소기업</option>
                <option value="중견기업">중견기업</option>
                <option value="대기업">대기업</option>
              </select>
              <div className={styles.div17}>선호분야</div>
              <select
                className={styles.inputBasic}
                value={formData.preferred_fields}
                onChange={(e) => handleInputChange('preferred_fields', e.target.value)}
              >
                <option value="">선택하세요</option>
                <option value="정보통신업">정보통신업</option>
                <option value="제조업">제조업</option>
                <option value="서비스업">서비스업</option>
              </select>
            </div>
            <div className={styles.groupContainer}>
              <div className={styles.div19}>소재지</div>
              <input
                className={styles.inputBasic}
                type="text"
                value={formData.location}
                onChange={(e) => handleInputChange('location', e.target.value)}
                placeholder="소재지를 입력하세요"
              />
            </div>
            <div className={styles.parent1}>
              <div className={styles.div23}>기업형태</div>
              <input
                className={styles.inputBasic}
                type="text"
                value={formData.business_form}
                onChange={(e) => handleInputChange('business_form', e.target.value)}
                placeholder="기업형태를 입력하세요"
              />
            </div>
          </div>
          <div className={styles.parent2}>
            <b className={styles.b4}>기업개요</b>
            <div className={styles.rectangleDiv} />
          </div>
          <div className={styles.parent3} onClick={onGroupContainerClick}>
            <b className={styles.b4}>재무정보</b>
            <div className={styles.groupChild1} />
          </div>
          <div className={styles.parent4} onClick={onGroupContainerClick}>
            <b className={styles.b4}>사업정보</b>
            <div className={styles.groupChild1} />
          </div>
          <div className={styles.parent5} onClick={onGroupContainerClick}>
            <b className={styles.b4}>가점정보</b>
            <div className={styles.groupChild1} />
          </div>
          <div className={styles.div30}>관리자</div>
          <div className={styles.div31}>
            <select className={styles.inputBasic}>
              <option value="">선택</option>
            </select>
          </div>
        </div>
        <div className={styles.ver2Child} />
        <div className={styles.frameDiv}>
          <div className={styles.rectangleGroup}>
            <div className={styles.groupChild4} />
            <img className={styles.locked1f5122Icon} alt="" src="locked_1f512 2.png" />
            <div className={styles.div33}>입력 정보는 안전하게 보호됩니다</div>
          </div>
          <img className={styles.frameChild} alt="" src="Vector 684.svg" />
          <b className={styles.b8}>완성도가 높을수록</b>
          <div className={styles.frameParent}>
            <div className={styles.groupParent1}>
              <div className={styles.rectangleContainer}>
                <div className={styles.groupChild5} />
                <div className={styles.div34}>기업 조건에 맞는 맞춤형 공고 추천</div>
                <div className={styles.div35}>정확한 매칭</div>
                <img className={styles.directHit1f3af1Icon} alt="" src="direct-hit_1f3af 1.png" />
              </div>
              <div className={styles.rectangleParent1}>
                <div className={styles.groupChild6} />
                <div className={styles.div36}>파트너사의 신뢰도 및 매칭률 증가</div>
                <div className={styles.div37}>신뢰도 향상</div>
                <img className={styles.shield1f6e1Fe0f1Icon} alt="" src="shield_1f6e1-fe0f 1.png" />
              </div>
              <div className={styles.rectangleParent2}>
                <div className={styles.groupChild7} />
                <div className={styles.div38}>완성된 프로필 우선 노출 및 추천</div>
                <div className={styles.div39}>우선 추천</div>
                <img className={styles.shield1f6e1Fe0f1Icon} alt="" src="star_2b50 1.png" />
              </div>
            </div>
            <div className={styles.groupChild8} />
            <b className={styles.b9}>아직 입력하지 않은 항목</b>
            <div className={styles.vectorGroup}>
              <img className={styles.vectorIcon1} alt="" src="Vector.svg" />
              <div className={styles.div40}>재무현황 (5개 연도)</div>
            </div>
            <div className={styles.vectorContainer}>
              <img className={styles.vectorIcon2} alt="" src="Vector.svg" />
              <div className={styles.div41}>주요 사업 분야</div>
            </div>
            <div className={styles.vectorParent1}>
              <img className={styles.vectorIcon3} alt="" src="Vector.svg" />
              <div className={styles.div42}>대표 실적</div>
            </div>
            <div className={styles.groupChild9} />
            <b className={styles.b10}>바로 입력하기</b>
          </div>
          <div className={styles.parent6}>
            <div className={styles.div43}>24%</div>
            <div className={styles.rectangleParent3}>
              <div className={styles.groupChild10} />
              <div className={styles.groupChild11} />
            </div>
            <div className={styles.div44}>
              <p className={styles.p}>새싹이 자라나고 있어요!</p>
              <p className={styles.p1}>조금만 더 채우면 더 좋은 매칭을 받을 수 있어요!</p>
            </div>
            <b className={styles.b11}>프로필완성도</b>
          </div>
          <img className={styles.image504Icon} alt="" src="image 504.png" />
        </div>
        <div className={styles.header}>
          <div className={styles.headerChild} />
          <div className={styles.chalkboardteacher} />
          <img className={styles.headerItem} alt="" src="Group 1000002831.svg" />
          <div className={styles.div45}>
            <b>이어봄 담당자</b>
            <span>님</span>
          </div>
          <div className={styles.am}>am</div>
          <div className={styles.div46}>06:20</div>
          <img className={styles.headerInner} alt="" src="Vector 240.svg" />
          <img className={styles.headerChild1} alt="" src="Vector 242.svg" />
          <b className={styles.b12}>대상자 관리</b>
          <img className={styles.monitorIcon} alt="" src="Monitor.svg" />
          <img className={styles.layoutIcon} alt="" src="Layout.svg" />
          <img className={styles.bellIcon} alt="" src="Bell.svg" />
        </div>
        <div className={styles.footer}>
          <div className={styles.component13Parent}>
            <div className={styles.component13} onClick={handleSave}>
              <div className={styles.component13Child} />
              <b className={styles.b13}>{loading ? '저장 중...' : '저장 및 다음단계'}</b>
              <img className={styles.caretrightIcon} alt="" src="CaretRight.svg" />
            </div>
            <div className={styles.component26}>
              <div className={styles.component26Child} />
              <b className={styles.b14}>건너뛰기</b>
            </div>
          </div>
        </div>
        <div className={styles.rectangleParent4}>
          <div className={styles.groupChild12} />
          <div className={styles.groupParent2}>
            <div className={styles.parent7}>
              <div className={styles.div47}>
                <div className={styles.div48}>사업 공고</div>
                <img className={styles.child1} alt="" src="Frame 1000004093.svg" />
              </div>
              <img className={styles.rectangleIcon} alt="" src="Rectangle 848.svg" />
            </div>
            <div className={styles.parent7}>
              <div className={styles.div49}>
                <div className={styles.div50}>관심 메뉴</div>
                <img className={styles.starFilledIcon} alt="" src="star_filled.svg" />
              </div>
              <img className={styles.groupChild13} alt="" src="Rectangle 850.svg" />
            </div>
            <div className={styles.parent7}>
              <div className={styles.div51}>
                <div className={styles.div50}>컨소시엄 매칭</div>
                <div className={styles.externalLink}>
                  <img className={styles.icon2} alt="" src="Icon.svg" />
                </div>
              </div>
              <img className={styles.groupChild13} alt="" src="Rectangle 850.svg" />
            </div>
            <div className={styles.parent10}>
              <div className={styles.div53}>
                <div className={styles.div54}>사용자 관리</div>
                <img className={styles.groupIcon} alt="" src="Group 1000002912.svg" />
              </div>
              <img className={styles.groupChild15} alt="" src="Rectangle 849.svg" />
            </div>
            <div className={styles.wrapper1}>
              <div className={styles.div55}>
                <div className={styles.div56}>사용자 관리</div>
              </div>
            </div>
            <div className={styles.parent11}>
              <div className={styles.div57}>
                <div className={styles.div58}>시스템 관리</div>
                <img className={styles.subtractIcon} alt="" src="Subtract.svg" />
              </div>
              <img className={styles.groupChild16} alt="" src="Rectangle 882.svg" />
            </div>
          </div>
          <div className={styles.resources}>Resources</div>
          <div className={styles.groupFrame}>
            <div className={styles.vectorParent2}>
              <img className={styles.groupChild17} alt="" src="Rectangle 852.svg" />
              <div className={styles.parent12}>
                <div className={styles.div59}>결제/계정 관리</div>
                <div className={styles.rectangleParent5}>
                  <div className={styles.groupChild18} />
                  <div className={styles.groupChild19} />
                  <div className={styles.groupChild20} />
                  <div className={styles.groupChild21} />
                </div>
              </div>
            </div>
          </div>
          <div className={styles.dashboard}>Dashboard</div>
          <i className={styles.partnerit}>PartnerIT</i>
          <img className={styles.groupChild22} alt="" src="Group 1000003770.svg" />
        </div>
      </div>
    </div>
  );
};

export default Companies;
